            <div className="container">
                <div className="socialmedia-cards">
                    <Card title={'@nathanf'} number={'1987'} icon={FacebookIcon} todaysNumber={'12'} todaysNumberIcon={iconUp} />
                    <Card title={'@nathanf'} number={'11k'} todaysNumber={'12'} todaysNumberIcon={iconUp} />
                    <Card title={'@nathanf'} number={'1987'} todaysNumber={'12'} todaysNumberIcon={iconUp} />
                    <Card title={'@nathanf'} number={'1987'} todaysNumber={'12'} todaysNumberIcon={iconUp} />
                </div>
            </div>
        </main>
    )
}
